import Navbar from "../components/Navbar";
import { useAuth } from "../components/auth";

function Simulator() {
    const { user, logout, isLoading } = useAuth();

    if (isLoading) {
        return null;
    }

    return (
        <div>
            <Navbar />

            {user ? <></> : <></>}
        </div>
    );
}

export default Simulator;
